import React from "react";
import {
    CircularProgressbar,
    CircularProgressbarWithChildren,
    buildStyles
  } from "react-circular-progressbar";
  import "react-circular-progressbar/dist/styles.css";

  // Animation
  import { easeQuadInOut } from "d3-ease";
  import AnimatedProgressProvider from "../AnimatedProgressProvider/AnimatedProgressProvider";
  import ChangingProgressProvider from "../ChargingProgressProvider/ChargingProgressProvider";

const Skills = () => {
  const html = 66;

  return (
    <div className="skills container-fluid ">
      <div className="contenedor">
        <div className="row">
          <div className="elemento1 col bg-primary">
            <div className="row ">
              <div className="col-12">
                <h3>Technical</h3>
              </div>
              <div className="col-2">
              <AnimatedProgressProvider
        valueStart={0}
        valueEnd={66}
        duration={1.4}
        easingFunction={easeQuadInOut}
        repeat
      >
        {value => {
          const roundedValue = Math.round(value);
          return (
            <CircularProgressbar
              value={value}
              text={`${roundedValue}%`}
              /* This is important to include, because if you're fully managing the
        animation yourself, you'll want to disable the CSS animation. */
              styles={buildStyles({ pathTransition: "none" })}
            />
          );
        }}
      </AnimatedProgressProvider>
              </div>
              <div className="col-2">
                <CircularProgressbar />
              </div>
            </div>
          </div>
          <div className="elemento2 col bg-warning">
            <div className="row">
              <div className="col-12">
                <h3>Soft</h3>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Skills;
